        #region Hardware Receive Data Routines
        /*
         * Let: j = 0, 1, 2... J-1, where J = 24                    -> j: sample index, J + 1: number of samples in a package
         *      sampleBytes                                         -> Number of bytes in a single sample
         *      headerBytes                                         -> Number of bytes of package header
         *      pckgBytes = ((J + 1) * sampleBytes) + headerBytes;  -> Number of bytes in a package
         *      SerialBuffer.Size = 2 * pckgBytes;                  -> Size of SerialBuffer double buffer (Cyotek.CircularBuffer)
         *      SampleValueBuffer.Size = 2 * (J + 1);               -> Size of SampleValueBuffer double buffer
         *      DataReceived = false;
         *      IsFirstBuffer = false;
         *      n = 0;
         *      
         * 1)   public void DataReceivedHandler(object sender, SerialDataReceivedEventArgs e)   //Serial will trigger DataReceivedHandler every time it receive something;
         *          if(MySerial.BytesToRead >= pckgBytes)                                       //Package is fully avaiable on MySerial.Buffer   
         *              DataReceived = true;
         *          
         * 2)   On a background thread:                                                         //void Serial_bgWorker_DoWork()
         *          if (DataReceived == true):
         *              Collect data:   SerialBuffer.Put(pckgBytes);                            //Add all bytes in the end of SerialBuffer + header
         *              Process data:   Find header: _ = SerialBuffer.Get(headersize)           //Remove header bytes at beggining of SerialBuffer 
         *                              int[] sampleValue[J];
         *                              for (int j = 0; j <= J ; j++)                             //Header must be the first bytes, if not, we lost samples...
         *                                  byte[] SampleBytes = SerialBuffer.Get(sampleBytes); //Remove sampleBytes in the beggining of SerialBuffer
         *                                  sampleValue[j] = BitConverter.ToInt32(SampleBytes); //convert sampleBytes to its bits value
         *                                  
         *      sampleValue[J] is the buffer containing J samples delivered by BLE              //We are sure that we got J new samples
         *                                  
         *                              for(i = 0 + n; i <= J + n; i++)
         *                                  SampleValueBuffer[i + n] = sampleValue[i];          //Update SampleValueBuffer double buffer
         *                              ~IsFirstBuffer;                                         //Invert boolean state
         *                              If(!IsFirstBuffer)                                      //Update n value
         *                                  n = 0; 
         *                              else
         *                                  n = J;
         *          DataReceived = false;
         *          
         * Simplified Process data:     Find header: _ = SerialBuffer.Get(headersize)                       //Remove header bytes at beggining of SerialBuffer 
         *                              for (j = 0 + n, j <= J + n; j++)                                    //Header must be the first bytes, if not, we lost samples...
         *                                  byte[] SampleBytes = SerialBuffer.Get(sampleBytes);             //Remove sampleBytes in the beggining of SerialBuffer
         *                                  SampleValueBuffer[j + n] = BitConverter.ToInt32(SampleBytes);   //Update SampleValueBuffer double buffer with sample value in bits
         *                               ~IsFirstBuffer;                                                    //Invert boolean state
         *                              If(!IsFirstBuffer)                                                  //Update n value
         *                                  n = 0; 
         *                              else
         *                                  n = J;
         *          DataReceived = false;
         *          
         * Now we have a small double buffer with new data. 
         * We have to put it's value on a big double buffer to save.
         * To plot data, we have to create an ObservableCollection<sample> where:
         *     public class sample
         *     {
         *          public int XData;
         *          public double YData;
         *     }   
         * 
         * Instead of updating SampleValueBuffer, we can simplify Process Data to directly update that big ObservableCollection double buffer. 
         * Let: nMax                            -> Maximum number of samples desired on buffer
         *      FyDoubleBuffer[2 * nMax];       -> Big ObservableCollection Double Buffer with 2x size of nMax
         *      sampleIndex = 0;                -> Current index of received sample
         *      calibConstant                   -> Sensor Calibration Constant (convert bits to Kg, any further manipulation will be from Kg to desired unit)
         * 
         * Simplified Process data:     Find header: _ = SerialBuffer.Get(headersize)                       //Remove header bytes at beggining of SerialBuffer 
         *                              for (j = 0 + n, j <= J + n; j++)                                     //Header must be the first bytes, if not, we lost samples...
         *                                  byte[] SampleBytes = SerialBuffer.Get(sampleBytes);             //Remove sampleBytes in the beggining of SerialBuffer
         *                                  FyDoubleBuffer.Add(new sample
         *                                  {
         *                                      XData = sampleIndex;
         *                                      YData = BitConverter.ToInt32(SampleBytes) * calibConstant;
         *                                  });
         *                                  
         *                                  if (sampleIndex > (nMax * 2) - 1)                               //This will keep FyDoubleBuffer with 2*nMax samples
         *                                      FyDoubleBuffer.RemoveAt(0);
         *                                      
         * So, the overall process will be:
		 *
		 * IsSerialFirstBuffer = false;
		 * nSerial = 0;
		 * DataReceived = false;
         * IsSampleFirstBuffer = false;
         * nSample = 0;
         * sampleBytes = 4;                                 //bytes
         * headerBytes = 4;                                 //bytes
         * byte[] header = new byte[]{ 68, 65, 84, 65 };    //Header array
         * J = 24;                                          //J + 1: samples in package
         * pckgBytes = 104                                  //25 samples of 4 bytes each + header
         * byte[] SerialBuffer = new byte[pckgBytes * 2]    //Not using cyotek cze is not compatible with .NET CORE
         * 
         * public void DataReceivedHandler(object sender, SerialDataReceivedEventArgs e)   //Serial DataReceivedHandler
         *     if(MySerial.BytesToRead >= pckgBytes)                                       //Package is fully avaiable on MySerial.Buffer   
         *         DataReceived = true;
         *          
         * void Serial_bgWorker_DoWork()                                                    //Background thread
         *     if (DataReceived == true)
		 *         byte[] DataBytes = new byte[pckgBytes];
         *         MySerial.Read(DataBytes, 0, pckgBytes);
		 *
		 *         for(int i = 0 + nSerial; i < pckgBytes + nSerial; i++)
		 *             SerialBuffer[i + nSerial] = DataBytes[i];
		 *         
		 *         ~IsSerialFirstBuffer;
		 *         if(!IsSerialFirstBuffer)
		 *             nSerial = 0;
		 *         else
		 *             nSerial = pckgBytes - 1;
		 *             
		 *         Data_Processing();
		 *         DataReceived = false;
		 * 
		 * void Data_Processing()
		 * {
		 *     if(SerialBuffer[0..headerBytes] == header) //buffer started with Header, sample ok
		 *         index = 0;
		 *         byte[] SampleBytes = SerialBuffer[n..n + pckgBytes]; //0-700,700-1400
		 *         for (j = 0 + n, j <= J + n; j++)
		 *             
		 *             FyDoubleBuffer.Add(new sample
		 *             {
		 *                 XData = sampleIndex;
		 *                 YData = BitConverter.ToInt32(SampleBytes[(header + 1) + (sampleBytes * j)..(header + 1) + (sampleBytes * (j + 1))]) * calibConstant;
		 *             });
		 *         ~IsDataFirstBuffer;
		 *         If(!IsDataFirstBuffer) 
		 *             nData = 0; 
		 *         else
		 *             nData = J;
		 *         
		 *     else
		 *         //search for index, 
		 *         //fix buffer until index = 0;
		 *         //copy last sample to FyDoubleBuffer?
		 * }

         */
        #endregion

