        void SerialDataService()
        {
            int nextIndex = Index + 1;

            int NSampleSliderValue = 1000;
            while (true)
            {
                for (int i = 0; i < 25; i++)
                {
                    if (nextIndex == datadoubleRaw.Length)
                        nextIndex = 0;

                    for(int k = 0; k < 6; k++)
                    {
                        if (CircularBuffer[k].Count() == NSampleSliderValue)
                        {
                            CircularBuffer[k].RemoveAt(0);
                            CircularBuffer[k].Add(new LiveGraphModel()
                            {
                                XData = Index,
                                YData = datadoubleRaw[nextIndex] + avarage * k
                            });
                            if (k == 5)
                            {
                                Index++;
                                nextIndex++;
                            }
                        }
                        else
                        {
                            double difer = NSampleSliderValue - CircularBuffer[k].Count();
                            if (difer > 0)
                            {
                                for (int x = 0; x < difer; x++)
                                {
                                    if (nextIndex == datadoubleRaw.Length)
                                        nextIndex = 0;
                                    CircularBuffer[k].Add(new LiveGraphModel()
                                    {
                                        XData = Index,
                                        YData = datadoubleRaw[nextIndex] + avarage * k
                                    });
                                    if (k == 5)
                                    {
                                        Index++;
                                        nextIndex++;
                                    }
                                }
                            }
                            else
                            {
                                for (int x = 0; x < Math.Abs(difer); x++)
                                    CircularBuffer[k].RemoveAt(0);
                            }
                        }
                    }


                }
                Thread.Sleep(25); 
            }
        }

        private void UpdatePlotBuffer()
        {
            LiveGraphSuspendNotifiCation?.Invoke();
            COPSuspendNotifiCation?.Invoke();

            LiveGraphModel[][] PlotBuffer = new LiveGraphModel[6][];
            for (int k = 0; k <6; k++)
            {
                PlotBuffer[k] = new LiveGraphModel[cBufferSize];
                CircularBuffer[k].CopyTo(PlotBuffer[k], 0);

                ObservableCollection<LiveGraphModel> TempData = new ObservableCollection<LiveGraphModel>();
                foreach (LiveGraphModel temp in PlotBuffer[k])
                {
                    if (temp != null)
                        TempData.Add(temp);
                }
                switch (k)
                {
                    case 0:
                        FyCircularBuffer = TempData;
                        break;
                    case 1:
                        MyCircularBuffer = TempData;
                        break;
                    case 2:
                        FxCircularBuffer = TempData;
                        break;
                    case 3:
                        MxCircularBuffer = TempData;
                        break;
                    case 4:
                        FzCircularBuffer = TempData;
                        break;
                    case 5:
                        MzCircularBuffer = TempData;
                        break;
                }
            }
            MaxXAxis = FyCircularBuffer.Last().XData;
            MinXAxis = MaxXAxis - 1000;
            PesoKg = FyCircularBuffer.Last().YData.ToString("#0.000");
            PesoNw = FyCircularBuffer.Last().YData.ToString("#0.000");

            ObservableCollection<COPGraphModel> TempCOP = new ObservableCollection<COPGraphModel>();
            TempCOP.Add(new COPGraphModel() { XData = rnd.Next(-30, 30), YData = rnd.Next(-20, 20) });
            COP_DOT = TempCOP;

            COPResumeNotification?.Invoke();
            LiveGraphResumeNotification?.Invoke();
        }


