        private void PopulateData(int num)
        {
            string[] strSplited = dataStringRaw.Split(';');
            datadoubleRaw = new double[strSplited.Length];
            for (int i = 0; i < strSplited.Length; i++)
                datadoubleRaw[i] = double.Parse(strSplited[i], culture);

            avarage = datadoubleRaw.Average();

            for (int k = 0; k < 6; k++)
            {
                CircularBuffer[k] = new ObservableCollection<LiveGraphModel>();
                for (int i = 0; i < strSplited.Length; i++)
                {
                    if (i < num)
                    {
                        CircularBuffer[k].Add(new LiveGraphModel()
                        {
                            XData = i,
                            YData = datadoubleRaw[i] + avarage * k
                        });
                    }
                }
            }
            Index = CircularBuffer[0].Last().XData;
            MaxXAxis = Index;
            MinXAxis = Index - num;

            UpdatePlotBuffer();

            LoadedData = true;
        }
    }

